function TW:newUnit(army, unit, x, y)
    local unitTemplate = self.unitTemplates[unit]
    table.insert(self.armies[army].units,
                 {unitId = unit,
                  army = army,
                  type = unitTemplate.type,
                  human = unitTemplate.human,
                  name = unit == "hq"
                     and (army == "red" and "Red" or "Blue") .. " HQ"
                      or unitTemplate.name[army] .. " " .. self.phoneticAlphabet[self.armies[army].currentPhoneticName],
                  health = 100,
                  energy = 100,
                  attack = unitTemplate.attack,
                  defense = unitTemplate.defense,
                  range = unitTemplate.range,
                  possibleMoves = {},
                  healthSoldierRatio = unitTemplate.healthSoldierRatio[army],
                  sprite = army == "red" and 1 or (unit == "hq" and 1 or 2),
                  visible = not (unit == "special"),
                  x = x, y = y})
    self.armies[army].currentPhoneticName = self.armies[army].currentPhoneticName + 1
    self.armies[army].unitCount = self.armies[army].unitCount + 1
end

function TW:removeUnit(army, unit)
    for i = 1, self.armies[army].unitCount do
        if self.armies[army].units[i] == unit then
            table.remove(self.armies[army].units, i)
            self.armies[army].unitCount = self.armies[army].unitCount - 1
        end
    end
end

function TW:countSoldiers(unit)
    if unit.health == 0 then
        return 0
    end
    local soldiers = math.floor((unit.health * unit.healthSoldierRatio) + 0.5)
    return soldiers == 0 and 1 or soldiers
end

function TW:calculateDamage(unitA, unitB)
    return math.floor(0.9 * unitA.attack * (10 - unitB.defense))
         + math.random(0, math.floor(self.armies[unitA.army].morale / 10))
end

function TW:calculateRange(unit)
    unit.range = math.ceil(math.sqrt(unit.energy) * (unit.range / 10))
end

function TW:getUnitAt(x, y, army)
    for i = 1, self.armies[army].unitCount do
        local unit = self.armies[army].units[i]
        if unit.x == x and unit.y == y then
            return unit
        end
    end
end

function TW:findCellsInRange(x, y, range)
    local cells = {}
    local currentCell = {x = x, y = y}
    local d = {x = 1, y = 1}
    for currentRange = 1, range do
        currentCell.x = x
        currentCell.y = y - currentRange
        for i = 1, 4 do
            d.x = (i == 1 or i == 4) and 1 or -1
            d.y = (i == 1 or i == 2) and 1 or -1
            for _ = 1, currentRange do
                if self:locationWithinBoundaries(currentCell.x, currentCell.y) then
                    table.insert(cells, {x = currentCell.x, y = currentCell.y})
                end
                currentCell.x = currentCell.x + d.x
                currentCell.y = currentCell.y + d.y
            end
        end
    end
    if range == 1 then
        table.insert(cells, {x = x - 1, y = y - 1})
        table.insert(cells, {x = x + 1, y = y - 1})
        table.insert(cells, {x = x - 1, y = y + 1})
        table.insert(cells, {x = x + 1, y = y + 1})
        local cellCount = #cells
        for i = cellCount - 3, cellCount do
            if not self:locationWithinBoundaries(cells[i].x, cells[i].y) then
                cells[i] = false
            end
        end
    end
    return cells
end

function TW:findPossibleMoves(unit)
    local possibleMoves = self:findCellsInRange(unit.x, unit.y, unit.range)
    local possibleMovesCount = #possibleMoves
    for i = 1, possibleMovesCount do
        if not possibleMoves[i]
        or not self:locationIsAccessible(possibleMoves[i].x, possibleMoves[i].y, unit) then
            possibleMoves[i] = false
        end
    end
    unit.possibleMoves = possibleMoves
end

function TW:findAllPossibleMoves()
    for i = 1, self.armies.red.unitCount do
        self:findPossibleMoves(self.armies.red.units[i])
    end
    for i = 1, self.armies.blue.unitCount do
        self:findPossibleMoves(self.armies.blue.units[i])
    end
end

function TW:locationWithinBoundaries(x, y)
    return x >= 1 and x <= self.mapWidth
       and y >= 1 and y <= self.mapHeight
end

function TW:locationIsAccessible(x, y, unit)
    if self.maps[self.currentMap][y][x] == 0 then
        return true
    end
    local length = unit.type:len()
    for i = 1, length do
        if unit.type:sub(i, i) == self.tileAttributes[self.maps[self.currentMap][y][x]] then
            return true
        end
    end
    return false
end

function TW:moveCursor(x, y)
    if x >= 1 and x <= self.mapWidth then
        self.cursor.x = x
    end
    if y >= 1 and y <= self.mapHeight  then
        self.cursor.y = y
    end
end

function TW:countTotal()
    local unitCount = self.data.unitsSelected[self.data.armySelectingUnits]
    return (unitCount.infantry * self.unitTemplates.infantry.cost)
         + (unitCount.special * self.unitTemplates.special.cost)
         + (unitCount.helicopter * self.unitTemplates.helicopter.cost)
         + (unitCount.tank * self.unitTemplates.tank.cost)
end

function TW:buildUnitList(army)
    for key, value in pairs(self.data.unitsSelected[army]) do
        for i = 1, value do
            table.insert(self.data.unitList[army], key)
        end
    end
end

function TW:locationWithinPlacableArea(x, y)
    local placableRect = self.placableArea[self.currentMap][self.data.armyPlacingUnits]
    return x >= placableRect[1]
       and y >= placableRect[2]
       and x < placableRect[1] + placableRect[3]
       and y < placableRect[2] + placableRect[4]
end

function TW:replenishEnergy()
    for i = 1, self.armies[self.otherPlayer].unitCount do
        local unit = self.armies[self.otherPlayer].units[i]
        unit.energy = unit.energy + self.energyGain > 100
                  and 100 or unit.energy + self.energyGain
    end
end

function TW:updateMorale()
    if self.tick < 10 then
        return
    end
    if self.armies.blue.morale > self.armies.red.morale then
        self.armies.red.morale = self.armies.red.morale + math.random(0, 1)
        self.armies.blue.morale = self.armies.blue.morale + math.random(-1, 0)
    else
        if self.armies.red.morale == self.armies.blue.morale then
            self.armies.red.morale = self.armies.red.morale + math.random(-1, 0)
            self.armies.blue.morale = self.armies.blue.morale + math.random(-1, 0)
        else
            self.armies.red.morale = self.armies.red.morale + math.random(-1, 0)
            self.armies.blue.morale = self.armies.blue.morale + math.random(0, 1)
        end
    end
    self.armies.red.morale = self.armies.red.morale < 0
                         and 0 or self.armies.red.morale
    self.armies.blue.morale = self.armies.blue.morale < 0
                          and 0 or self.armies.blue.morale
end

function TW:returnToMenu()
    self:init()
    self.status.onSplashScreen = false
    self.status.onMenuScreen = true
end

function TW:placeNextUnit(x, y)
    if not self:locationWithinPlacableArea(x, y) 
    or not self:locationIsAccessible(x, y, self.unitTemplates[self.data.unitList[self.data.armyPlacingUnits][self.data.unitListIndex]])
    or self:getUnitAt(x, y, self.data.armyPlacingUnits) then
        return
    end
    self:newUnit(self.data.armyPlacingUnits,
                 self.data.unitList[self.data.armyPlacingUnits][self.data.unitListIndex],
                 x, y)
    if self.data.armyPlacingUnits == "red"
   and self.data.unitListIndex == #self.data.unitList.red then
        self.data.armyPlacingUnits = "blue"
        self.currentPlayer = "blue"
        self.data.unitListIndex = 1
        local lastCombatUnit = self.armies.red.units[self.armies.red.unitCount - 1]
        self.armies.red.lastLocation = {x = lastCombatUnit.x, y = lastCombatUnit.y}
        self.cursor = {x = self.placableArea[self.currentMap].blue[1],
                       y = self.placableArea[self.currentMap].blue[2]}
    elseif self.data.armyPlacingUnits == "blue"
       and self.data.unitListIndex == #self.data.unitList.blue then
        self.currentPlayer = "red"
        local lastCombatUnit = self.armies.blue.units[self.armies.blue.unitCount - 1]
        self.armies.blue.lastLocation = {x = lastCombatUnit.x, y = lastCombatUnit.y}
        self.cursor = {x = self.armies.red.lastLocation.x,
                       y = self.armies.red.lastLocation.y}
        self:findAllPossibleMoves()
        self.status.placingUnits = false
    else
        self.data.unitListIndex = self.data.unitListIndex + 1
    end
end

function TW:selectionMenuEnterKey()
    if self.data.selectionMenuChoice == 1 then
        if self.data.selectedUnit.range == 0 then
            return
        end
        self.status.movingUnit = true
        self.status.onSelectionMenu = false
    elseif self.data.selectionMenuChoice == 2 then
        if self.data.selectedUnit.range == 0 then
            return
        end
        self.status.attackingUnit = true
        self.status.onSelectionMenu = false
    elseif self.data.selectionMenuChoice == 3 then
        self.status.onInfoWindow = true
        self.status.onSelectionMenu = false
    end
end

function TW:moveAttackEnterKey()
    local validMove = false
    local possibleMovesCount = #self.data.selectedUnit.possibleMoves
    for i = 1, possibleMovesCount do
        if self.data.selectedUnit.possibleMoves[i]
       and self.cursor.x == self.data.selectedUnit.possibleMoves[i].x
       and self.cursor.y == self.data.selectedUnit.possibleMoves[i].y then
            validMove = true
            break
        end
    end
    if not validMove then
        return
    end
    if self.status.movingUnit then
        if self:getUnitAt(self.cursor.x, self.cursor.y, "red")
        or self:getUnitAt(self.cursor.x, self.cursor.y, "blue") then
            return
        end
        if self.cursor.x < self.data.selectedUnit.x then
            self.data.selectedUnit.sprite = 2
        elseif self.cursor.x > self.data.selectedUnit.x then
            self.data.selectedUnit.sprite = 1
        end
        self.data.selectedUnit.x = self.cursor.x
        self.data.selectedUnit.y = self.cursor.y
        self:findPossibleMoves(self.data.selectedUnit)
    elseif self.status.attackingUnit then
        local attackedUnit = self:getUnitAt(self.cursor.x, self.cursor.y, self.otherPlayer)
        if not attackedUnit then
            return
        end
        self.data.selectedUnit.visible = true
        attackedUnit.visible = true
        local soldiersBefore = self:countSoldiers(attackedUnit)
        local damage = self:calculateDamage(self.data.selectedUnit, attackedUnit)
        local healthBefore = attackedUnit.health
        attackedUnit.health = attackedUnit.health - damage
        if attackedUnit.health <= 0 then
            if attackedUnit.unitId == "hq"
            or self.armies[attackedUnit.army].units[2].unitId == "hq" then
                self.status.victory = true
            end
            self.armies[self.currentPlayer].damageDone = self.armies[self.currentPlayer].damageDone + healthBefore
            self.armies[self.currentPlayer].previousDamage = healthBefore
            self.armies[self.currentPlayer].morale = self.armies[self.currentPlayer].morale + self.moraleIncrease > 100
                                                 and 100 or self.armies[self.currentPlayer].morale + self.moraleIncrease
            self.armies[self.otherPlayer].deaths = self.armies[self.otherPlayer].deaths + soldiersBefore
            self:removeUnit(attackedUnit.army, attackedUnit)
        else
            self.armies[self.currentPlayer].damageDone = self.armies[self.currentPlayer].damageDone + damage
            self.armies[self.currentPlayer].previousDamage = damage
            self.armies[self.otherPlayer].deaths = self.armies[self.otherPlayer].deaths + (soldiersBefore - self:countSoldiers(attackedUnit))
        end
    end
    if self.status.movingUnit then
        self.armies[self.currentPlayer].lastLocation = {x = self.cursor.x,
                                                        y = self.cursor.y}
    end
    self.cursor = {x = self.armies[self.otherPlayer].lastLocation.x,
                   y = self.armies[self.otherPlayer].lastLocation.y}
    self.otherPlayer = self.currentPlayer
    self.currentPlayer = self.currentPlayer == "red" and "blue" or "red"
    self.status.onMainView = true
    self.status.movingUnit = false
    self.status.attackingUnit = false
    self.data.selectionMenuChoice = 1
    local energyDrain = math.ceil(math.sqrt((self.data.selectedUnit.x ^ 2) + (self.data.selectedUnit.y ^ 2))) + 3
    self.data.selectedUnit.energy = self.data.selectedUnit.energy - energyDrain < 0
                                and 0 or self.data.selectedUnit.energy - energyDrain
    self:replenishEnergy()
    self:updateMorale()
    self:calculateRange(self.data.selectedUnit)
    self.tick = self.tick + 1
end

function TW:mouseDown(x, y)
    if self.status.onPauseWindow
    or self.status.victory then
        return
    end
    if self.status.onMainView
    or self.status.movingUnit
    or self.status.attackingUnit then
        if x < 256 and y < 208 then
            self.cursor.x = math.floor(x / self.spriteSize) + 1
            self.cursor.y = math.floor(y / self.spriteSize) + 1
        end
    end
end

function TW:arrowKey(key)
    if self.status.victory then
        return
    end
    if self.status.onPauseWindow then
        if key == "up" then
            self.data.pauseMenuChoice = self.data.pauseMenuChoice == 1
                                    and 2 or self.data.pauseMenuChoice - 1
        elseif key == "down" then
            self.data.pauseMenuChoice = self.data.pauseMenuChoice == 2
                                    and 1 or self.data.pauseMenuChoice + 1
        end
    elseif self.status.onMainView or self.status.movingUnit
    or self.status.attackingUnit then
        if key == "up" then
            self:moveCursor(self.cursor.x, self.cursor.y - 1)
        elseif key == "down" then
            self:moveCursor(self.cursor.x, self.cursor.y + 1)
        elseif key == "left" then
            self:moveCursor(self.cursor.x - 1, self.cursor.y)
        elseif key == "right" then
            self:moveCursor(self.cursor.x + 1, self.cursor.y)
        end
    elseif self.status.onSelectionMenu then
        if self.data.selectedUnit.range == 0 then
            return
        end
        if key == "up" then
            self.data.selectionMenuChoice = self.data.selectionMenuChoice == 1
                                        and 3 or self.data.selectionMenuChoice - 1
        elseif key == "down" then
            self.data.selectionMenuChoice = self.data.selectionMenuChoice == 3
                                        and 1 or self.data.selectionMenuChoice + 1
        end
    elseif self.status.onUnitScreen then
        if key == "up" then
            self.data.unitSelectionChoice = self.data.unitSelectionChoice == 1
                                        and 4 or self.data.unitSelectionChoice - 1
        elseif key == "down" then
            self.data.unitSelectionChoice = self.data.unitSelectionChoice == 4
                                        and 1 or self.data.unitSelectionChoice + 1
        elseif key == "left" then
            local unitsSelected = self.data.unitsSelected[self.data.armySelectingUnits][self.data.unitOrder[self.data.unitSelectionChoice]]
            if unitsSelected > 0 then
                self.data.unitsSelected[self.data.armySelectingUnits][self.data.unitOrder[self.data.unitSelectionChoice]] = unitsSelected - 1
            end
            self.data.totalCost[self.data.armySelectingUnits] = self:countTotal()
        elseif key == "right" then
            local unitsSelected = self.data.unitsSelected[self.data.armySelectingUnits][self.data.unitOrder[self.data.unitSelectionChoice]]
            if unitsSelected < 10 then
                self.data.unitsSelected[self.data.armySelectingUnits][self.data.unitOrder[self.data.unitSelectionChoice]] = unitsSelected + 1
                local totalCost = self:countTotal()
                if totalCost > 100 then
                    self.data.unitsSelected[self.data.armySelectingUnits][self.data.unitOrder[self.data.unitSelectionChoice]] = unitsSelected
                else
                    self.data.totalCost[self.data.armySelectingUnits] = totalCost
                end
            end
        end
    end
end

function TW:enterKey()
    if self.status.onSplashScreen then
        self.status.onSplashScreen = false
        self.status.onMenuScreen = true
    elseif self.status.onUnitScreen then
        if self.data.armySelectingUnits == "red"
       and self.data.totalCost.red > 0 then
            self.data.armySelectingUnits = "blue"
            self.data.unitSelectionChoice = 1
        elseif self.data.armySelectingUnits == "blue"
           and self.data.totalCost.blue > 0 then
            self:buildUnitList("red")
            self:buildUnitList("blue")
            self.status.onUnitScreen = false
            self.status.onMenuScreen = false
            self.status.onMainView = true
            self.status.placingUnits = true
            self.cursor = {x = self.placableArea[self.currentMap].red[1],
                           y = self.placableArea[self.currentMap].red[2]}
        end
    elseif self.status.onPauseWindow then
        if self.data.pauseMenuChoice == 1 then
            self.status.onPauseWindow = false
        elseif self.data.pauseMenuChoice == 2 then
            self:returnToMenu()
        end
    elseif self.status.victory then
        self:returnToMenu()
    elseif self.status.onMainView then
        if self.status.placingUnits then
            self:placeNextUnit(self.cursor.x, self.cursor.y)
        else
            local unit = self:getUnitAt(self.cursor.x, self.cursor.y, self.currentPlayer)
            if unit then
                self.status.onSelectionMenu = true
                self.data.selectedUnit = unit
                self.status.onMainView = false
                if self.data.selectedUnit.range == 0 then
                    self.data.selectionMenuChoice = 3
                end
            end
        end
    elseif self.status.onSelectionMenu then
        self:selectionMenuEnterKey()
    elseif self.status.onInfoWindow then
        self.status.onSelectionMenu = true
        self.status.onInfoWindow = false
    elseif self.status.movingUnit or self.status.attackingUnit then
        self:moveAttackEnterKey()
    end
end

function TW:escapeKey()
    if self.status.onMenuScreen then
        if self.status.onAboutWindow then
            self.status.onAboutWindow = false
        elseif self.status.onMapScreen then
            self.status.onMapScreen = false
        elseif self.status.onUnitScreen then
            if self.data.armySelectingUnits == "blue" then
                self.data.armySelectingUnits = "red"
                self.data.unitSelectionChoice = 1
            else
                self.data.unitSelectionChoice = 1
                self.data.unitsSelected = {red = {infantry = 0, special = 0, helicopter = 0, tank = 0, hq = 1},
                                           blue = {infantry = 0, special = 0, helicopter = 0, tank = 0, hq = 1}}
                self.status.onUnitScreen = false
                self.status.onMapScreen = true
            end
        elseif self.status.onHelpScreen then
            self.status.onHelpScreen = false
        else
            self.status.onMenuScreen = false
            self.status.onSplashScreen = true
        end
    elseif self.status.onAboutWindow then
        self.status.onAboutWindow = false
    elseif self.status.onSelectionMenu or self.status.onInfoWindow
        or self.status.movingUnit or self.status.attackingUnit then
        self.status.onSelectionMenu = false
        self.status.onInfoWindow = false
        self.status.movingUnit = false
        self.status.attackingUnit = false
        self.data.selectionMenuChoice = 1
        self.cursor.x = self.data.selectedUnit.x
        self.cursor.y = self.data.selectedUnit.y
        self.status.onMainView = true
    elseif self.status.onMainView and not self.status.victory then
        self.status.onPauseWindow = not self.status.onPauseWindow
    end
end

function TW:charIn(c)
    if self.status.onMenuScreen then
        if self.status.onMapScreen then
            if c:byte() >= 49 and c:byte() <= 57 then
                local mapNumber = c:byte() - 48
                if mapNumber >= 1 and mapNumber <= #self.maps then
                    self.currentMap = mapNumber
                    self.status.onMapScreen = false
                    self.status.onUnitScreen = true
                end
            end
        elseif self.status.onUnitScreen then
            if c:byte() >= 48 and c:byte() <= 57 then
                local oldUnitCount = self.data.unitsSelected[self.data.armySelectingUnits][self.data.unitOrder[self.data.unitSelectionChoice]]
                self.data.unitsSelected[self.data.armySelectingUnits][self.data.unitOrder[self.data.unitSelectionChoice]] = c:byte() - 48
                local totalCost = self:countTotal()
                if totalCost > 100 then
                    self.data.unitsSelected[self.data.armySelectingUnits][self.data.unitOrder[self.data.unitSelectionChoice]] = oldUnitCount
                else
                    self.data.totalCost[self.data.armySelectingUnits] = totalCost
                end
            end
        else
            if c == "1" then
                self.status.onMapScreen = true
            elseif c == "2" then
                self.status.onHelpScreen = true
            elseif c == "3" then
                self.status.onAboutWindow = true
            end
        end
    end
    if c == "d" then
        self.debug = not self.debug
    end
    if not self.status.victory and not self.status.onPauseMenu then
        if c == "0" then
            self.circleAroundUnits = not self.circleAroundUnits
        end
    end
end

function TW:drawPlacableArea()
    local placableRect = self.placableArea[self.currentMap][self.data.armyPlacingUnits]
    self.gc:setAlpha(196)
    if self.data.armyPlacingUnits == "red" then
        self.gc:setColorRGB(242, 7, 23)
    else
        self.gc:setColorRGB(25, 102, 179)
    end
    self.gc:fillRect(self.spriteSize * (placableRect[1] - 1),
                     self.spriteSize * (placableRect[2] - 1),
                     self.spriteSize * placableRect[3],
                     self.spriteSize * placableRect[4])
end

function TW:drawMap()
    for i = 1, self.mapHeight do
        for j = 1,self.mapWidth do
            if self.maps[self.currentMap][i][j] ~= 0 then
                self.gc:drawImage(self.tiles[self.maps[self.currentMap][i][j]],
                                  self.spriteSize * (j - 1),
                                  self.spriteSize * (i - 1))
            end
        end
    end
end

function TW:drawUnits()
    local maxUnitCount = self.armies.red.unitCount > self.armies.blue.unitCount
                     and self.armies.red.unitCount
                     or self.armies.blue.unitCount
    local redUnits = self.armies.red.units
    local blueUnits = self.armies.blue.units
    for i = 1, maxUnitCount do
        if i <= self.armies.red.unitCount
       and (self.currentPlayer == "red" or redUnits[i].visible) then
            self.gc:drawImage(self.unitTemplates[redUnits[i].unitId].sprites.red[redUnits[i].sprite],
                              self.spriteSize * (redUnits[i].x - 1),
                              self.spriteSize * (redUnits[i].y - 1))
            if redUnits[i].unitId == "hq" then
                self.gc:drawImage(self.unitTemplates.hq.sprites.red[2],
                                  self.spriteSize * (redUnits[i].x - 1),
                                  self.spriteSize * (redUnits[i].y - 2))
            end
            if self.currentPlayer == "red" and self.circleAroundUnits then
                self.gc:setPen("medium", "smooth")
                self.gc:setColorRGB(242, 7, 23)
                self.gc:drawArc((self.spriteSize * (redUnits[i].x - 1)) - 5,
                                (self.spriteSize * (redUnits[i].y - 1)) - 5,
                                17, 17, 0, 360)
            end
        end
        if i <= self.armies.blue.unitCount 
       and (self.currentPlayer == "blue" or blueUnits[i].visible) then
            self.gc:drawImage(self.unitTemplates[blueUnits[i].unitId].sprites.blue[blueUnits[i].sprite],
                              self.spriteSize * (blueUnits[i].x - 1),
                              self.spriteSize * (blueUnits[i].y - 1))
            if blueUnits[i].unitId == "hq" then
                self.gc:drawImage(self.unitTemplates.hq.sprites.blue[2],
                                  self.spriteSize * (blueUnits[i].x - 1),
                                  self.spriteSize * (blueUnits[i].y - 2))
            end
            if self.currentPlayer == "blue" and self.circleAroundUnits then
                self.gc:setPen("medium", "smooth")
                self.gc:setColorRGB(25, 102, 179)
                self.gc:drawArc((self.spriteSize * (blueUnits[i].x - 1)) - 5,
                                (self.spriteSize * (blueUnits[i].y - 1)) - 5,
                                17, 17, 0, 360)
            end
        end
    end
end

function TW:drawPossibleMoves(unit)
    local possibleMovesCount = #unit.possibleMoves
    if self.currentPlayer == "red" then
        self.gc:setColorRGB(242, 7, 23)
    else
        self.gc:setColorRGB(25, 102, 179)
    end
    self.gc:setAlpha(196)
    for i = 1, possibleMovesCount do
        if unit.possibleMoves[i] then
            local drawMove = false
            if self.status.movingUnit then
                if not (self:getUnitAt(unit.possibleMoves[i].x, unit.possibleMoves[i].y, "red")
                     or self:getUnitAt(unit.possibleMoves[i].x, unit.possibleMoves[i].y, "blue")) then
                    drawMove = true
                end
            elseif self.status.attackingUnit then
                if self:getUnitAt(unit.possibleMoves[i].x, unit.possibleMoves[i].y, self.otherPlayer) then
                    drawMove = true
                end
            end
            if drawMove then
                self.gc:fillRect(self.spriteSize * (unit.possibleMoves[i].x - 1),
                                 self.spriteSize * (unit.possibleMoves[i].y - 1),
                                 self.spriteSize,
                                 self.spriteSize)
            end
        end
    end
end

