function TW:drawCursor()
    self.gc:setAlpha(255)
    if self.status.placingUnits then
        local unitId = self.data.unitList[self.data.armyPlacingUnits][self.data.unitListIndex]
        self.gc:drawImage(self.unitTemplates[unitId].sprites[self.data.armyPlacingUnits][self.data.armyPlacingUnits == "red" and 1 or (unitId == "hq" and 1 or 2)],
                          self.spriteSize * (self.cursor.x - 1),
                          self.spriteSize * (self.cursor.y - 1))
        if unitId == "hq" then
            self.gc:drawImage(self.unitTemplates.hq.sprites[self.data.armyPlacingUnits][2],
                              self.spriteSize * (self.cursor.x - 1),
                              self.spriteSize * (self.cursor.y - 2))
        end
    else
        self.gc:setPen("thin", "smooth")
        if self.currentPlayer == "red" then
            self.gc:setColorRGB(170, 4, 17)
        else
            self.gc:setColorRGB(16, 66, 116)
        end
        self.gc:drawRect(self.spriteSize * (self.cursor.x - 1) - 1,
                         self.spriteSize * (self.cursor.y - 1) - 1,
                         9, 9)
    end
end

