    self.gc:drawImage(self.images[unit.army], unit.unitId == "hq" and 32 or 161, offsetY + 58)
    self.gc:setColorRGB(255, 255, 255)
    self.gc:fillRect(33, offsetY + 83, 190, height)
    self.gc:setColorRGB(0, 0, 0)
    self.gc:drawRect(32, offsetY + 82, 191, height + 1)
    self.gc:setFont("sansserif", "b", 9)
    local nameOffsetX = 216 - self.gc:getStringWidth(unit.name)
    self.gc:drawString(unit.name, nameOffsetX, offsetY + 83, "top")
    if unit.unitId == "hq" then
        self.gc:setFont("sansserif", "b", 10)
        local offsetX = 81 - ((18 + self.gc:getStringWidth(unit.health)) / 2)
        self.gc:drawImage(self.images.heart, offsetX, 144)
