        self.gc:drawString("Health:", 42, offsetY + 103, "top")
        self.gc:drawString(unit.human and "Fatigue:" or "Fuel:", 42, offsetY + 117, "top")
        self.gc:drawString("Soldiers:", 42, offsetY + 131, "top")
    end
    self.gc:drawString("Attack:", 138, offsetY + 103, "top")
    self.gc:drawString("Defense:", 137, offsetY + 117, "top")
    self.gc:drawString("Range:", 137, offsetY + 131, "top")
    self.gc:drawString(unit.range, 179, offsetY + 131, "top")
