        self.gc:drawString(self:countSoldiers(unit) .. " / " .. (100 * unit.healthSoldierRatio), 85, offsetY + 131, "top")
        self:drawProgressBar(unit.health, 85, offsetY + 107, 30, 6, {242, 7, 23})
        self:drawProgressBar(unit.human and 100 - unit.energy or unit.energy, 85, offsetY + 121, 30, 6, {46, 153, 37})
