function TW:drawProgressBar(value, x, y, width, height, color)
    self.gc:setColorRGB(0, 0, 0)
    self.gc:drawRect(x, y, width + 1, height + 1)
    self.gc:setColorRGB(color[1], color[2], color[3])
    self.gc:fillRect(x + 1, y + 1, (value / 100) * width, height)
end

function TW:drawBarProgressBar(value, x, y, width, height, spacing, color)
    local offsetX = x
    self.gc:setColorRGB(color[1], color[2], color[3])
    for i = 0, value - 1 do
        self.gc:fillRect(offsetX, y, width, height)
        offsetX = offsetX + width + spacing
    end
    self.gc:setColorRGB(196, 196, 196)
    for i = value, 9 do
        self.gc:fillRect(offsetX, y, width, height)
        offsetX = offsetX + width + spacing
    end
end

