        self.gc:drawString(tostring(unit.attack) .. " / " .. tostring(unit.defense) .. " / " .. tostring(unit.range), x + 90, y - 3, "top")
        self.gc:drawString(unit.cost, x + 140, y - 3, "top")
        self.gc:drawString(self.data.unitsSelected[self.data.armySelectingUnits][key], (x + 179) - (self.gc:getStringWidth(tostring(self.data.unitsSelected[self.data.armySelectingUnits][key])) / 2), y - 3, "top")
        self.data.unitOrder[i] = key
        i = i + 1
    end
    self.gc:drawImage(self.images.incDecArrows, 276, (20 * self.data.unitSelectionChoice) + 59)
    self.gc:drawString("Total: " .. tostring(self.data.totalCost[self.data.armySelectingUnits]) .. "/100", 250, 157, "top")
    self.gc:drawString("Total: " .. tostring(self.data.totalCost[self.data.armySelectingUnits]) .. "/100", 249, 157, "top")
    self.gc:drawImage(self.images.continueText, 236, 189)
end

function TW:drawPauseWindow()
    self.gc:setAlpha(196)
    self.gc:fillRect(0, 0, 318, 212)
    self:drawSmallWindow(95, 55)
    self.gc:setFont("sansserif", "r", 9)
    self.gc:setColorRGB(0, 0, 0)
    self.gc:drawString("Return", 132, 97, "top")
    self.gc:drawString("Quit to menu", 132, 113, "top")
    self.gc:drawImage(self.images.selectionArrow, 120, 88 + (16 * self.data.pauseMenuChoice))
    self.gc:drawImage(self.images.returnText, 5, 186)
end

function TW:drawVictoryWindow()
    self.gc:setAlpha(196)
    self.gc:fillRect(0, 0, 318, 212)
    self:drawSmallWindow(95, 55)
    self.gc:setColorRGB(255, 255, 255)
    self.gc:fillRect(107, 64, 105, 17)
    self.gc:drawImage(self.images.victoriousText, 87, 69)
    self.gc:setFont("sansserif", "b", 9)
    self.gc:setColorRGB(0, 0, 0)
    local winner = self.otherPlayer == "red" and "Red" or "Blue"
    self.gc:drawString(winner .. " is", 105, 61, "top")
    local moveCount = self.otherPlayer == "red" and math.floor(self.tick / 2) + 1 or self.tick / 2
    self.gc:setFont("sansserif", "r", 8)
    local winInfoString = winner .. " won in " .. tostring(moveCount) .. " moves!"
    self.gc:drawString(winInfoString, 159 - (self.gc:getStringWidth(winInfoString) / 2), 129, "top")
    self.gc:drawImage(self.images.returnToMenuText, 5, 185)
end

function TW:drawMenu()
    self.gc:setColorRGB(20, 41, 54)
    self.gc:fillRect(0, 0, 318, 45)
    self.gc:setColorRGB(223, 238, 247)
    self.gc:fillRect(0, 45, 318, 167)
    if not self.status.onUnitScreen and not self.status.onHelpScreen then
        self.gc:drawImage(self.images.squadBlack, 8, 150)
    end
    if self.status.onAboutWindow then
        self.gc:drawImage(self.images.twMenuText, 12, 10)
        self:drawAboutWindow()
    elseif self.status.onMapScreen then
        self.gc:drawImage(self.images.twSelectMapText, 12, 10)
        self.gc:drawImage(self.images.maps, 117, 66)
    elseif self.status.onUnitScreen then
        self:drawUnitSelection()
    elseif self.status.onHelpScreen then
        self.gc:drawImage(self.images.twHelpText, 12, 10)
        self.gc:drawImage(self.images.helpText, 10, 55)
    else
        self.gc:drawImage(self.images.twMenuText, 12, 10)
        self.gc:drawImage(self.images.menuText, 134, 90)
    end
    self.gc:drawImage(self.images.returnText, self.status.onUnitScreen and 5 or 246, 190)
end

function TW:drawHelpScreen()

end

function TW:drawDebug()
    self.gc:setFont("sansserif", "r", 8)
    self.gc:setColorRGB(255, 0, 255)
    local i = 0
    for k, v in pairs(self.status) do
        self.gc:drawString(k, 0, 10 * i, "top")
        self.gc:drawString(v and 1 or 0, 80, 10 * i, "top")
        i = i + 1
    end
    i = 0
    self.gc:drawString("t=" .. tostring(self.tick), 100, 10 * i, "top")
    i = 1
    for j = 1, self.armies.red.unitCount do
        local unit = self.armies.red.units[j]
        self.gc:drawString(tostring(j) .. ": " .. tostring(unit.health) .. "," .. tostring(unit.energy), 100, 10 * i, "top")
        i = i + 1
    end
    for j = 1, self.armies.blue.unitCount do
        local unit = self.armies.blue.units[j]
        self.gc:drawString(tostring(j) .. ": " .. tostring(unit.health) .. "," .. tostring(unit.energy), 100, 10 * i, "top")
        i = i + 1
    end
    self.gc:drawString("m=" .. tostring(self.armies.red.morale) .. ",m=" .. tostring(self.armies.blue.morale), 100, 10 * i, "top")
end

function TW:drawAll()
    if self.status.onSplashScreen then
        self.gc:drawImage(self.images.splash, 0, 0)
        return
    elseif self.status.onMenuScreen then
        self:drawMenu()
        return
    end
    self:drawGround()
    self:drawMap()
    self:drawUnits()
    if self.status.placingUnits then
        self:drawPlacableArea()
    end
    self:drawCursor()
    self:drawBorders()
    if not self.status.placingUnits then
        self:drawHUD()
    end
    if self.status.onSelectionMenu then
        self:drawSelectionMenu()
    elseif self.status.onInfoWindow then
        self:drawInfoWindow(self.data.selectedUnit)
    elseif self.status.movingUnit then
        self:drawPossibleMoves(self.data.selectedUnit)
    elseif self.status.attackingUnit then
        self:drawPossibleMoves(self.data.selectedUnit)
    elseif self.status.placingUnits then
        self.gc:fillRect(256, 0, 62, 212)
        self.gc:drawImage(self.images.placeYourUnitsText, 252, 20)
        self.gc:drawImage(self.images[self.data.armyPlacingUnits], 256, 169)
    end
    if self.status.onPauseWindow then
        self:drawPauseWindow()
    elseif self.status.victory then
        self:drawVictoryWindow()
    end
end

function on.mouseDown(x, y)
    tw:mouseDown(x, y)
    platform.window:invalidate()
end

function on.arrowKey(key)
    tw:arrowKey(key)
    platform.window:invalidate()
end

function on.enterKey()
    tw:enterKey()
    platform.window:invalidate()
end

function on.escapeKey()
    tw:escapeKey()
    platform.window:invalidate()
end

function on.charIn(c)
    tw:charIn(c)
    platform.window:invalidate()
end

local initialized = false
function on.paint(gc)
    if not initialized then
        tw = TW()
        initialized = true
    end
    tw:drawAll()
    if tw.debug then
        tw:drawDebug()
    end
end